import React from 'react'

export default function BetAnimal() {
    return (
        <div className="mt-3">
            <img src="./img/AnimalBetGameImage/bau.png" style={{ width: '100%' }} alt="" />
            <div className="bg-success mt-2">
                <button className="mt-2 bt-2">+</button>
                <span className="mt-2" style={{ color:'yellow', fontSize:25 }}>100</span>
                <button className="mt-2 bt-2" style={{ fontSize: '25px', width:30, height:30 }}>-</button>
            </div>
        </div>
    )
}
